import React from 'react';

import NicknameEditForm from '../components/NicknameEditForm';
import AppLayout from '../components/AppLayout';
import FollowList from '../components/FollowList';

const Profile = () => {
  const followerList = [{ nickname: '김지원' }, { nickname: '스타벅스' }, { nickname: '자바칩프라푸치노' }];
  const followingList = [{ nickname: '김지원' }, { nickname: '보노보노' }, { nickname: '마카롱도먹고싶다' }];

  return (
    <AppLayout>
      <NicknameEditForm />
      <FollowList
        header="팔로잉 목록"
        data={followingList}
      />
      <FollowList
        header="팔로워 목록"
        data={followerList}
      />
    </AppLayout>
  );
};

export default Profile;
